@Override
public final ByteBufferIndexInput clone() {
  final ByteBufferIndexInput clone = buildSlice(0L, this.length);
  try {
    clone.seek(getFilePointer());
  } catch(IOException ioe) {
    throw new RuntimeException("Should never happen: " + this, ioe);
  }

  return clone;
}

